import { Link } from 'react-router-dom';
import styled from 'styled-components';
import facebook from '../../src/Resources/images/facebook.svg';
import linkdin from '../../src/Resources/images/linkdin.svg';
import twitter from '../../src/Resources/images/twitter.svg';
import ig from '../../src/Resources/images/ig.svg';
const footerimg = new URL(
  "../../src/Resources/images/footerimg.png",
  import.meta.url
);

const Footer = () => {

    const Footer = styled.div`
      .footergen {
        background: #00111b;

        padding: 40px 35px;
      }

      .groupfooter1 {
        display: flex;
        justify-content: space-between;
      }

      .groupfooter1 a {
        text-decoration: none;
        font-size: 33px;
        font-weight: bold;
        color: white;
        margin-bottom: 35px;
      }

      .groupfooter1 a span {
        color: #32cd32;
      }

      .groupfooter1 p {
        color: aliceblue;
        font-size: 13px;
        margin-bottom: 35px;
        font-weight: 200;
      }

      .groupfooter1 h5 {
        color: aliceblue;
        margin-bottom: 15px;
        font-size: 16px;
        font-weight: 400;
